import classes from "./Shop.module.css";
import Products from "./Products";
import Card from "../UI/Card";

const DUMMY_PRODUCTS = [
  { id: "p1", path: "../images/camera.jpeg", name: "Camera", price: 699 },
  { id: "p2", path: "../images/shoes.jpeg", name: "Shoes", price: 99 },
  { id: "p3", path: "../images/telephone.jpeg", name: "Telephone", price: 199 },
];

const Shop = () => {
  return (
    <Card>
      <h3>Products</h3>
      <Products />
    </Card>
  );
};

export default Shop;
